insert  into `questions`(`question_id`,`question`,`difficulty_id`,`with_img`,`img_dir`,`correct_ans`,`created_at`,`updated_at`) values 
(18305,'A potter can make jars at a cost of 165 pesos each. If the potter sells the jar for x pesos each, it is estimated that 250 - 3x jars will be sold per month. Express the total revenue, R(x), of selling jars per month as a function of x.',3,0,NULL,'R(x) = 250x - 3x^2',NULL,NULL),
(18306,'A toy maker can make 30 toys in a month at a cost of x pesos each. The toy maker sells the toys for 3x + 1 pesos each. Suppose, he can sell all the toys he made, express the total profit, P(x), of selling toys per month as a function of x.',3,0,NULL,'P(x) = 60x + 30',NULL,NULL),
(18307,'Charles wishes to make open boxes from a square piece of cardboard with a side that measures 10 inches by cutting equal squares from the four corners and turning the sides. Let x inches be the length of the side of the square to be cut out. Express the number of cubic inches in the volume of the box as the function of x.',3,0,NULL,'V(x) = 4x^3 - 40x^2 + 100x',NULL,NULL),
(18308,'A rectangular lot is to be enclosed with a 200 meter fence. Let x meters be the length of the field, express the number of square meters in the area of the field as a function of x.',3,0,NULL,'A(x) = 100x - x^2',NULL,NULL),
(18309,'A rectangular beach resort is to be fenced using 240 meters of fencing materials, and no fence is required along the shoreline. Let x meters be the length of each side perpendicular to the shoreline, express the number of square meter in the area of the beach resort as a function of x.',3,0,NULL,'A(x) = 240x - 2x^2',NULL,NULL),
(18310,'A rectangular lot is to be enclosed using a fence worth PHP 18,000. The shorter sides cost PHP 60.00 per running foot, and the longer sides cost PHP 80.00 per running foot. Let x be the length of the shorter side, express the number of square feet of the area of the plot as a function of x.',3,0,NULL,'A(x) = (225/2)x - (3/4)x^2',NULL,NULL),
(18318,'A projectile is shot straight upward 5 m from the ground with an initial velocity of 35 m/s. The height of the projectile, s, in meters, after t seconds, is s(t) = 5 + 35t - 9.8t^2. Calculate the height of the projectile after 3.5 seconds.',3,0,NULL,'7.45 m',NULL,NULL),
(18319,'The electric current, in amperes, that passes through a circuit at a fixed voltage of 220 volts can be described by the function I(R) = 220/R where R is the resistance of the circuit in ohms. How much current passes through a circuit with the resistance of 10 ohms?',3,0,NULL,'22 amperes',NULL,NULL),
(18324,'In evaluating functions, the input is the value of the dependent variable while output is/are the value/s of the independent variable.',2,0,NULL,'FALSE',NULL,NULL),
(18325,'The functions f and g are defined as f(x) = x - 3 and g(x) = x^2 + 2. Which of the following defines f + g?',2,0,NULL,'x^2 + x - 1',NULL,NULL),
(18326,'The functions f and g are defined as f(x) = x^2 + 2x - 3 and g(x) = x^2 + 3. Which of the following defines f - g?',2,0,NULL,'2x - 6',NULL,NULL),
(18327,'The functions f and g are defined as f(x) = x - 2 and g(x) = x + 2. Which of the following defines f · g?',2,0,NULL,'x^2 - 4',NULL,NULL),
(18328,'The functions f and g are defined as f(x) = x^2 + x - 12 and g(x) = x + 4. Which of the following defines f / g?',2,0,NULL,'x - 3',NULL,NULL),
(18329,'The functions f and g are defined as f(x) = √(x+2) and g(x) = x^2 - 1. Which of the following defines f of g?',2,0,NULL,'x + 1',NULL,NULL),
(18332,'The functions f and g are defined as f(x) = x + 1 and g(x) = (x - 1)/2. Match the first column with the result of performing operation of functions.',3,0,NULL,'1) D, 2) A, 3) E, 4) C, 5) B',NULL,NULL),
(18333,'If the functions f and g are defined as f(x) = √x + 1 and g(x) = x2 - 1, then which of the following has the definition x + 2√x?',2,0,NULL,'g(f(x))',NULL,NULL),
(18334,'Which of the following statements is always true about the operation of functions? I. f(x) + g(x) = g(x) + f(x), II. f(g(x)) = g(f(x)), III. f(x) - g(x) = g(x) - f(x)',2,0,NULL,'I only',NULL,NULL),
(18335,'A projectile is fired directly upward with an initial velocity of 350 feet per second. Its heights is a function of time given by h(t) = - 16t^2 + 350t. Calculate the height after 3.25 seconds.',2,0,NULL,'968.5 feet',NULL,NULL),
(18336,'The evacuation authorities figured out that the cost in PHP per day per evacuee is a function, C(n) = 0.02n^2 - 4n + 500, where n is the number of evacuees. What is the minimum cost per day per evacuee?',2,0,NULL,'PHP 300',NULL,NULL),
